There are several ways a web application can communicate between two browser tabs:

### 1. **Local Storage**

You can use the `localStorage` API to store data in one tab and retrieve it in another. This method is simple but has limitations, as the data is stored locally and can be cleared by the user.

**Example:**
```javascript
// Tab 1
localStorage.setItem('message', 'Hello from Tab 1!');

// Tab 2
const message = localStorage.getItem('message');
console.log(message); // Output: "Hello from Tab 1!"
